<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="Amazon">Amazon<a class="anchor-link" href="#Amazon">&#182;</a></h1><p>This notebook is an example on how to use the Vertica ML Python Library. We will use the Amazon dataset to predict the number of forest fires in Brazil. You can download the Jupyter Notebook of the study by clicking <a href="amazon.ipynb">here</a>. To achieve our goals, we have access to the following data.</p>
<p><ul class="ul_content">
    <li><b>date: </b>Date of the record</li>
    <li><b>number: </b>Number of forest fires</li>
    <li><b>state: </b>State in Brazil</li>
</ul></p>
<p>We will follow the entire Data Science cycle (Data Exploration - Data Preparation - Data Modeling - Model Evaluation - Model Deployment) and solve this easy use-case. The purpose is to show you some of the library interesting functionalities.</p>
