<span class="n">amazon</span> <span class="o">=</span> <span class="n">load_amazon</span><span class="p">()</span>
<span class="n">amazon</span><span class="o">.</span><span class="n">head</span><span class="p">(</span><span class="mi">5</span><span class="p">)</span>
</pre></div>

